instance_from_id ( int instance_id )
added_in:3.0 
Returns the Object that corresponds to instance_id. All Objects have a unique instance ID.
var foo = "bar"
func _ready():
    var id = get_instance_id()
    var inst = instance_from_id(id)
    print(inst.foo) # Prints bar

var2str ( Variant var )
added_in:3.0 
Converts a Variant var to a formatted string that can later be parsed using str2var.
a = { "a": 1, "b": 2 }
print(var2str(a))
prints
{
"a": 1,
"b": 2
}

yield ( Object object=null, String signal="" ) added_in:3.0 Stops the function execution and returns the current suspended state to the calling function. From the caller, call GDScriptFunctionState.resume on the state to resume execution. This invalidates the state. Within the resumed function, yield() returns whatever was passed to the resume() function call. If passed an object and a signal, the execution is resumed when the object emits the given signal. In this case, yield() returns the argument passed to emit_signal() if the signal takes only one argument, or an array containing all the arguments passed to emit_signal() if the signal takes multiple arguments. You can also use yield to wait for a function to finish: func _ready(): yield(countdown(), "completed") # waiting for the countdown() function to complete print('Ready')
func countdown(): yield(get_tree(), "idle_frame") # returns a GDScriptFunctionState object to _ready() print(3) yield(get_tree().create_timer(1.0), "timeout") print(2) yield(get_tree().create_timer(1.0), "timeout") print(1) yield(get_tree().create_timer(1.0), "timeout")
# prints: # 3 # 2 # 1 # Ready When yielding on a function, the completed signal will be emitted automatically when the function returns. It can, therefore, be used as the signal parameter of the yield method to resume. In order to yield on a function, the resulting function should also return a GDScriptFunctionState. Notice yield(get_tree(), "idle_frame") from the above example.

get_stack ( ) added_in:3.1 Returns an array of dictionaries representing the current call stack. func _ready(): foo()
func foo(): bar()
func bar(): print(get_stack()) would print [{function:bar, line:12, source:res://script.gd}, {function:foo, line:9, source:res://script.gd}, {function:_ready, line:6, source:res://script.gd}]
